import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <div className="App">
      <h1>E-com Project</h1>
      <button>Normal Button</button>
      <Button>BootStrap Button</Button>
    </div>
  );
}

export default App;
